import React, { useState, useEffect } from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom';
import './styles/GlobalStyles.css';
import Login from './pages/Login';
import Register from './pages/Register';
import Logout from './pages/Logout';
import Profile from './pages/Profile';
import CreateSkill from './pages/CreateSkill';
import AllSkills from './pages/AllSkills';
import MySkills from './pages/MySkills';
import EditSkill from './pages/EditSkill';
import ReceivedRequests from './pages/ReceivedRequests';
import SentRequests from './pages/SentRequests';
import SessionList from './pages/SessionList';
import AdminLogin from './pages/AdminLogin';
import AdminDashboard from './pages/AdminDashboard';
import UserDashboard from './pages/UserDashboard';
import Navbar from './components/Navbar';

// Layout wrapper for pages with floating background + theme toggle
const Layout = ({ children }) => {
  const [theme, setTheme] = useState('dark-theme');

  useEffect(() => {
    document.body.className = theme;
  }, [theme]);

  const toggleTheme = () => {
    setTheme(prev => (prev === 'dark-theme' ? 'light-theme' : 'dark-theme'));
  };

  return (
    <div>
      <Navbar />
      <div className="floating-shapes">
        {[...Array(6)].map((_, i) => (
          <div key={i} className="floating-shape"></div>
        ))}
      </div>
      <div className="particles">
        {[...Array(8)].map((_, i) => (
          <div key={i} className="particle"></div>
        ))}
      </div>
      <button className="theme-btn theme-toggle" onClick={toggleTheme}>
        {theme === 'dark-theme' ? 'ðŸŒž Light' : 'ðŸŒ™ Dark'}
      </button>
      <div>{children}</div>
    </div>
  );
};

function App() {
  const isLoggedIn = !!localStorage.getItem('token');

  return (
    <Router>
      <Routes>
        {/* Pages without layout */}
        <Route path="/login" element={<Login />} />
        <Route path="/register" element={<Register />} />
        <Route path="/logout" element={<Logout />} />

        {/* Pages with floating background and theme */}
        <Route path="/" element={<Layout><Navigate to={isLoggedIn ? "/dashboard" : "/login"} /></Layout>} />
        <Route path="/dashboard" element={<Layout><UserDashboard /></Layout>} />
        <Route path="/skills" element={<Layout><AllSkills /></Layout>} />
        <Route path="/skills/create" element={<Layout><CreateSkill /></Layout>} />
        <Route path="/skills/edit/:id" element={<Layout><EditSkill /></Layout>} />
        <Route path="/skills/mine" element={<Layout><MySkills /></Layout>} />
        <Route path="/requests/received" element={<Layout><ReceivedRequests /></Layout>} />
        <Route path="/requests/sent" element={<Layout><SentRequests /></Layout>} />
        <Route path="/sessions" element={<Layout><SessionList /></Layout>} />
        <Route path="/profile" element={<Layout><Profile /></Layout>} />

        {/* Admin routes */}
        <Route path="/admin/login" element={<AdminLogin />} />
        <Route path="/admin/dashboard" element={<Layout><AdminDashboard /></Layout>} />

        {/* Catch-all route */}
        <Route path="*" element={<Navigate to={isLoggedIn ? "/dashboard" : "/login"} />} />
      </Routes>
    </Router>
  );
}

export default App;
